import React from 'react'

const Settings = () => {
  return (
    <div className='d-flex flex-wrap justify-content-around align-items-center bg-dark bg-gradient' style={{height:"100vh"}}>
      <button type="button" className="d-flex flex-wrap btn btn-success fs-3 text-center" style={{width: "25%", height:"10%"}}>Weather city</button>
      <button type="button" className="btn btn-success fs-3" style={{width: "25%", height:"10%"}}>Weather detail</button>
      <button type="button" className="btn btn-success fs-3" style={{width: "25%", height:"10%"}}>New City</button>
    </div>
  )
}

export default Settings
